export function Navbar({ variant = "transparent" }: NavbarProps) {
  const [mobileOpen, setMobileOpen] = useState(false);
  const [scrolled, setScrolled] = useState(false);

  useEffect(() => {
    if (variant !== "transparent") return;
    const onScroll = () => setScrolled(window.scrollY > 50);
    window.addEventListener("scroll", onScroll, { passive: true });
    return () => window.removeEventListener("scroll", onScroll);
  }, [variant]);

  const effectiveVariant =
    variant === "transparent" && scrolled ? "white" : variant;
  const isTransparent = effectiveVariant === "transparent";
  const isDark = effectiveVariant === "dark";
  const isWhite = effectiveVariant === "white";

  return (
    <header
      className={cn(
        "fixed top-0 left-0 right-0 z-50 transition-colors",
        isTransparent && "bg-transparent",
        isWhite && "bg-dld-white border-b border-dld-border",
        isDark && "bg-dld-dark/80 backdrop-blur-md",
      )}
    >
      <div className="mx-auto flex h-20 max-w-7xl items-center justify-between px-6">
        {/* Left: Government emblem */}
        <Link
          href="/"
          className="flex items-center"
          aria-label="Government of Dubai"
        >
          <GovernmentEmblem isWhite={isWhite} />
        </Link>

        {/* Right: UAE Pass + DLD Logo + Hamburger */}
        <div className="flex items-center gap-4">
          {/* UAE Pass button */}
          <button
            className={cn(
              "hidden md:flex items-center gap-2 rounded-full px-5 py-2.5 text-xs font-bold uppercase tracking-widest transition-colors",
              isWhite
                ? "border border-dld-border bg-dld-surface text-dld-black hover:bg-dld-border"
                : "bg-white/5 backdrop-blur-sm border border-white/10 text-dld-white hover:bg-white/10",
            )}
            aria-label="Sign in with UAE Pass"
          >
            <FingerprintIcon isWhite={isWhite} />
            <span>Sign in with UAE Pass</span>
          </button>

          {/* DLD Logo */}
          <Link href="/" aria-label="Dubai Land Department">
            <DLDLogo isWhite={isWhite} />
          </Link>

          {/* Hamburger menu */}
          <button
            onClick={() => setMobileOpen(!mobileOpen)}
            className="p-1"
            aria-label={mobileOpen ? "Close menu" : "Open menu"}
          >
            {mobileOpen ? (
              <svg
                viewBox="0 0 36 36"
                fill="none"
                stroke="currentColor"
                strokeWidth="2.5"
                className={cn(
                  "size-9",
                  isWhite ? "text-dld-black" : "text-dld-white",
                )}
              >
                <line x1="10" y1="10" x2="26" y2="26" strokeLinecap="round" />
                <line x1="26" y1="10" x2="10" y2="26" strokeLinecap="round" />
              </svg>
            ) : (
              <HamburgerIcon
                className={cn(
                  "size-9",
                  isWhite ? "text-dld-black" : "text-dld-white",
                )}
              />
            )}
          </button>
        </div>
      </div>

      {/* Mobile menu */}
      {mobileOpen && (
        <div
          className={cn(
            "border-t backdrop-blur-md",
            isWhite
              ? "border-dld-border bg-dld-white/95"
              : "border-white/10 bg-dld-dark/95",
          )}
        >
          <nav
            className="flex flex-col px-6 py-4 gap-4"
            aria-label="Mobile navigation"
          >
            <Link
              href="/"
              className={cn(
                "text-sm font-medium",
                isWhite ? "text-dld-text-secondary" : "text-dld-white/80",
              )}
              onClick={() => setMobileOpen(false)}
            >
              Home
            </Link>
            <Link
              href="/services"
              className={cn(
                "text-sm font-medium",
                isWhite ? "text-dld-text-secondary" : "text-dld-white/80",
              )}
              onClick={() => setMobileOpen(false)}
            >
              Services
            </Link>
            <button
              className={cn(
                "flex items-center gap-2 rounded-full px-5 py-2.5 text-xs font-bold uppercase tracking-widest w-fit",
                isWhite
                  ? "border border-dld-border bg-dld-surface text-dld-black"
                  : "bg-white/5 backdrop-blur-sm border border-white/10 text-dld-white",
              )}
              aria-label="Sign in with UAE Pass"
            >
              <FingerprintIcon />
              <span>Sign in with UAE Pass</span>
            </button>
          </nav>
        </div>
      )}
    </header>
  );
}
